import React from 'react';

import './ThirdPanel.css';
import Illustration from './Illustration';

const ThirdPanel = () => {
  return (
    <div className='ThirdPanel-talldiv'>
      <div className='ThirdPanel-container'>
        <Illustration />
        <div className='ThirdPanel-text-container'>
          <div className='ThirdPanel-text'>Contact me</div>
          <div className='ThirdPanel-secondary-text'>
            After looking at your website, you might be dieing to talk to me.
            You can reach me by email: <a>here</a>, linkedin: <a>here</a>
          </div>
        </div>
      </div>
    </div>
  );
};

export default ThirdPanel;
